import React from 'react';
import PropTypes from 'prop-types';
import ps from '../assets/ps.svg';

const CuadroSoftware = ({ alt, texto }) => {
  return (
    <div className="software-item">
      <div className="titulo-soft">
        <h1>{texto}</h1>
      </div>
      <div className="software-contenido">
        <img src={ps} alt={alt} className="software-imagen" loading="lazy" />
      </div>
      <div className="texto">
        <p className="software-texto">{texto}</p>
      </div>
    </div>
  );
};

CuadroSoftware.propTypes = {
  alt: PropTypes.string.isRequired,
  texto: PropTypes.string.isRequired,
};

export default CuadroSoftware;
